import React from 'react'; 
import './App.css';
import Wrapper from './components/Wrapper'; 

function App() {
  return (
    <Wrapper>
      <div className="container"> 
        <div className="row"> 
          THIS IS ROW 1
        </div>
        <div className="row">
          THIS IS ROW 2
        </div>
      </div>
    </Wrapper>
  );
}

export default App;
